function Div2 () {
    return (
        <>
            <div className={MChStyles.d3_d2}>
                {
                   packageSummaryDetails2.map(packageDetail=>
                       <DefaultBlock key={packageDetail.k} k={packageDetail.k} title={packageDetail.title} items={packageDetail.items} children={undefined}/>
                    )
                }
            </div>
        </>
    )
}
export default Div2
